class Solution:
    def visiblePoints(self, points, angle, location):
        import math
        import bisect
        n = len(points)
        angle = math.radians(angle)
        v = []
        for xi, yi in points:
            if xi == location[0] and yi == location[1]:
                v.append(0)
            else:
                v.append(math.atan2(yi - location[1], xi - location[0]))
        v.sort()
        v += [deg + 2 * math.pi for deg in v]
        max_visible = 0
        for i in range(len(v)):
            count = bisect.bisect_right(v, v[i] + angle) - i
            max_visible = max(max_visible, count)
        return max_visible + v.count(0)
